function getUserInfo(){var e;e="https://api.github.com/users/"+window.GITHUB_USER,fetch(e).then(function(e){200!==e.status&&console.log("Looks like there was a problem"),e.json().then(function(e){var t;t=_.template(document.getElementById("presentation_tmpl").innerHTML),document.getElementById("presentation").innerHTML=t({user:e})})})}document.addEventListener("DOMContentLoaded",function(e){getUserInfo()});